Rosario de Acuña (1851-1923) fue una escritora, periodista y dramaturga española, considerada una de las principales representantes del librepensamiento y del feminismo en España durante la segunda mitad del siglo XIX y principios del XX. Este soneto refleja su estilo característico, que combina la forma clásica con contenido social y filosófico.
